    if (arr1.length && arr2.length) {
      res.push(arr1[0] > arr2[0] ? arr2.shift() : arr1.shift())
    } else if (arr1.length) {
      res.push(arr1.shift())
    } else if (arr2.length) {
      res.push(arr2.shift())
    }
  }
  return res
}

